resources.string:
Припомнете си преживяванията от местата, където сте били, като разглеждате снимките си с информация за местоположението, включително запазени от вас споделени снимки. Картата ви използва информация за местоположението, като например:

 • данни от GPS на камерата;
 • открити забележителности.

Снимките и видеоклиповете в заключената папка, на които не е създадено резервно копие, няма да бъдат съхранени, ако:

 • преминете на друго устройство;
 • възстановите фабричните настройки на това устройство;
 • изтриете приложението Google Снимки.

Google Снимки ще изтрие за постоянно следните данни от приложението на устройството ви: 

• информацията за профилите, в които сте влезли; 
• настройките; 
• снимките и видеоклиповете в заключената папка, на които не е създадено резервно копие. 

Снимките и видеоклиповете ви извън заключената папка и другите данни от приложението няма да бъдат изтрити.
